import React from 'react';
import './Sidebar.css';

const Sidebar = () => (
  <div className="sidebar">
    <h2>Menu</h2>
    <ul>
      <li>Dashboard</li>
      <li>Results</li>
    </ul>
  </div>
);

export default Sidebar;
